{"changed":true,"filter":false,"title":"page1.php","tooltip":"/page1.php","value":"\n<!DOCTYPE html>\n<html>\n    <head>\n        <meta charset=\"utf-8\">\n        <title>Operating Systems</title>\n        <link  href=\"css/style.css\" rel=\"stylesheet\">\n        <link href=\"https://fonts.googleapis.com/css?family=Pacific\" rel=\"stylesheet\">\n    </head>\n    <body>\n        <header>\n           <h1> Operating Systems </h1>\n        </header><hr />\n        <nav>\n            <a href=\"page1.php\">HOME</a>\n            <a href=\"page2.php\">VIRTUALIZER</a>\n            <a href=\"page3.php\">API</a>\n            <a href=\"page4.php\">RESOURCE MANAGER</a> \n        </nav>\n         <br /><br />\n         \n         \n         \n         <main>\n            <div>\n                 <h3> Welcome to the Operating Systems home page!</h3>\n                \n            <figure>\n                <img id=\"page1pic\" src=\"img/matrix.jpg\" alt=\"Picture of OS\" class=\"center\">\n            </figure>\n                \n               \n                \n                <p>On this site, you will find useful information which will give you an inside of what operating systems is about. First off:</p>\n                \n\n                \n                <h2>WHAT IS AN OPERATING SYSTEM?</h2>\n                <p>Operating Systems is software which starts a computer and keeps it running and responding to commands. The operating system has many tasks such as:</p>\n                \n                <p class =\"p1\">\n                <ul>\n                      <li>Runs applications</li>\n                      <li>Creates and maintains the UI (User Interface)</li>\n                      <li>Manages and controls the file system</li>\n                      <li>Communicates between hardware</li>\n                </ul>\n                \n                \n            </div>\n        </main>\n        \n        \n        \n        \n        <footer>\n        <a href=\"https://www.dummies.com/computers/operating-systems/what-is-an-operating-system/\">Source</a>\n        </footer>\n    </body>\n    </html>\n    ","undoManager":{"mark":10,"position":14,"stack":[[{"start":{"row":59,"column":4},"end":{"row":59,"column":10},"action":"insert","lines":["<html>"],"id":2}],[{"start":{"row":59,"column":5},"end":{"row":59,"column":6},"action":"insert","lines":["/"],"id":4}],[{"start":{"row":40,"column":18},"end":{"row":40,"column":19},"action":"remove","lines":["1"],"id":5},{"start":{"row":40,"column":18},"end":{"row":40,"column":19},"action":"insert","lines":[" "]},{"start":{"row":40,"column":19},"end":{"row":40,"column":20},"action":"insert","lines":["c"]},{"start":{"row":40,"column":20},"end":{"row":40,"column":21},"action":"insert","lines":["l"]},{"start":{"row":40,"column":21},"end":{"row":40,"column":22},"action":"insert","lines":["a"]},{"start":{"row":40,"column":22},"end":{"row":40,"column":23},"action":"insert","lines":["s"]},{"start":{"row":40,"column":23},"end":{"row":40,"column":24},"action":"insert","lines":["s"]}],[{"start":{"row":40,"column":24},"end":{"row":40,"column":25},"action":"insert","lines":[" "],"id":6},{"start":{"row":40,"column":25},"end":{"row":40,"column":26},"action":"insert","lines":["="]}],[{"start":{"row":40,"column":26},"end":{"row":40,"column":28},"action":"insert","lines":["\"\""],"id":7}],[{"start":{"row":40,"column":27},"end":{"row":40,"column":28},"action":"insert","lines":["p"],"id":8},{"start":{"row":40,"column":28},"end":{"row":40,"column":29},"action":"insert","lines":["1"]}],[{"start":{"row":47,"column":19},"end":{"row":47,"column":20},"action":"remove","lines":["1"],"id":9}],[{"start":{"row":40,"column":28},"end":{"row":40,"column":29},"action":"remove","lines":["1"],"id":10},{"start":{"row":40,"column":28},"end":{"row":40,"column":29},"action":"insert","lines":["2"]}],[{"start":{"row":40,"column":28},"end":{"row":40,"column":29},"action":"remove","lines":["2"],"id":11}],[{"start":{"row":40,"column":28},"end":{"r